import React from "react";
import { connect } from "react-redux";
import {
  BarChart,
  Bar,
  Cell,
  XAxis,
  YAxis,
  CartesianGrid,
  Tooltip,
  Legend
} from "recharts";

function BarGraph({ scores }) {
  console.log({ scores });
  scores.forEach(score => data.push({ name: Object.key(score), score: score }));
  const data = [
    {
      name: "Page A",
      pv: 2400
    },
    {
      name: "Page B",
      pv: 1398
    },
    {
      name: "Page C",
      pv: 9800
    },
    {
      name: "Page D",
      pv: 3908
    },
    {
      name: "Page E",
      pv: 4800
    },
    {
      name: "Page F",
      pv: 3800
    }
  ];

  return (
    <BarChart
      width={500}
      height={300}
      data={data}
      margin={{
        top: 5,
        right: 30,
        left: 20,
        bottom: 5
      }}
    >
      <CartesianGrid strokeDasharray="3 3" />
      <XAxis dataKey="name" />
      <YAxis />
      <Tooltip />
      <Legend />
      <Bar dataKey="pv" fill="#8884d8" />
    </BarChart>
  );
}
const mapStateToProps = state => {
  return {
    scores: state.scores
  };
};
export default connect(mapStateToProps, {})(BarGraph);
